import * as React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

function createData(Name, Category, Director, Release_year, Poster) {
  return { Name, Category, Director, Release_year, Poster};
}

const rows = [
  createData('Oppenheimer', 'Thriller/Historical Drama','Christopher Nolan',2023, 'https://i.redd.it/5huwogv9rwc91.jpg'),
  createData('Interstellar', 'Sci-fi', 'Christopher Nolan', 2014, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSE1uQDMzJX_dYVuOHqBKY_shQDgKGFqOgs0A&s'),
  createData('Charlie and the Chocolate Factory','Family/Fantasy','Tim Burton',2005,'data:image/jpeg;base64,'),
  createData('Green Book','Comedy/Musical','Peter Farrelly',2018,'data:image/jpeg;base64,'),
  createData('The Conjuring','Horror','James Wan',2013,'data:image/jpeg;base64,'),
];

export default function CustomizedTables() {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 700 }} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Title</StyledTableCell>
            <StyledTableCell align="right">Category</StyledTableCell>
            <StyledTableCell align="right">Director</StyledTableCell>
            <StyledTableCell align="right">Release Year</StyledTableCell>
            <StyledTableCell align="right">Poster</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.Name}>
              <StyledTableCell component="th" scope="row">
                {row.Name}
              </StyledTableCell>
              <StyledTableCell align="right">{row.Category}</StyledTableCell>
              <StyledTableCell align="right">{row.Director}</StyledTableCell>
              <StyledTableCell align="right">{row.Release_year}</StyledTableCell>
              <StyledTableCell align="right">
                <img src={row.Poster} alt={`${row.Name} poster`} style={{ width: 50, height: 75 }} />
              </StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
